// @flow
import * as React from 'react';

import styles from './button.module.css';

type Props = {|
  label: string,
  onClick: () => void,
  primary?: boolean,
|};

const Button = ({ label, onClick, primary }: Props) => (
  <div
    className={primary ? styles.primaryButton : styles.button}
    onClick={onClick}
  >
    {label}
  </div>
);

export default Button;
